import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  const clickStyle = { color: "red" };
  return (
    <header>
      <ul className="gnb">
        <li>
          <NavLink activeStyle={clickStyle} to="/Community">
            Community
          </NavLink>
        </li>
      </ul>
    </header>
  );
};

export default Header;
